  \"Self-Deploying, Composite Habitats Project\",\n\t\"tracking_summary\": {\n\t\t\"total\":
  1,\n\t\t\"recent\": 0\n\t},\n\t\"groups\": [],\n\t\"relationships_as_subject\":
  [],\n\t\"revision_timestamp\": \"2015-05-06T21:20:43.930918\",\n\t\"name\": \"self-deploying-composite-habitats-project\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"Cornerstone Research Group, Inc. (CRG),
  proposes to develop self-deploying, composite structures for lunar habitats, based
  on CRG's Veritex&lt;SUP&gt;TM&lt;/SUP&gt; materials. These structures will provide
  a rigid, durable habitat that will reduce the risk of mechanical failure due to
  crew or environmentally induced damage compared with inflatable structures that
  are more susceptible to punctures and damage from micrometeoroid impacts. Veritex
  is a composite material consisting of common reinforcement fibers, such as e-glass,
  carbon, Kevlar&lt;SUP&gt;REG&lt;/SUP&gt;, or high-strain capable fabrics, and one
  of CRG's shape memory polymers (SMP). Veritex materials will return to a memorized
  shape when raised above a specific activation temperature. This unique feature enables
  the use of Veritex as a primary lunar structure for its predictability and repeatability,
  which will offer quick, self-deploying lunar habitat that can return to a rigid
  enclosure after the deployment process. The development of expanding composite habitats
  will offer increased packing efficiency compared with fully rigid structures that
  lack expandable characteristics and waste valuable cargo space. This habitation
  structures technology will achieve Technology Readiness Level (TRL) 4 during Phase
  1 with proof-of-concept feasibility studies and will be designed for future implementation
  into lunar and Martian outposts.\",\n\t\"license_title\": \"U.S. Government Work\",\n\t\"extras\":
